INSERT INTO `attivita` (`CodAtt`, `DescAtt`) VALUES
	('ANALISI', 'E\' il tempo (espresso in h/uomo) che è stato speso per l\'Analisi della MEV. Questa voce deve essere indicata anche se la MEV viene successivamente annullata, sospesa, ecc. perché comunque sarà oggetto di fatturazione alla fine del mese. Non deve mai essere azzerata. La figura prevista per questa fase è un Senior.'),
	('STESURA STIMA', 'E\' il tempo (espresso in h/uomo) che viene speso per stendere la stima, aggiornare i fogli Excel e poi inviare la stima a ICBPI. Si noti che è un\'attività che viene fatta anche se poi la MEV viene annullata. Quindi, come già previsto per la colonna "Analisi", anche questa voce viene messa nel calcolo dei volumi e fatturata alla fine del mese. Di solito contiene un numero molto basso (es. 0,50 per indicare la mezz\'ora). La figura previesta per questa fase è un Junior.'),
	('SVILUPPO', 'E\' il tempo (espresso in h/uomo) che viene speso per effettuare la vera e propria attività di sviluppo software. La figura prevista per questa fase è un Junior.'),
	('COORDINAMENTO', 'E\' il tempo (espresso in h/uomo) che viene speso per gestire tutte le attività di coordinamento (es. contati con ICBPI per chiarimenti sull\'Analisi, per proporre e discutere aspetti implementativi di dettaglio, attività necessaria per aggiornare i consuntivi sui vari fogli Excel, incontri e discussioni interne legate all\'implementazione, alla ricostruzione di un contesto di test, ecc.). La figura prevista per questa fase è un Senior.'),
	('TEST C/O ICBPI', 'E\' il tempo (espresso in h/uomo) che viene speso per effettuare i test da parte SOFTEAM sull\'infrastruttura ICBPI. E\' l\'attività finale necessaria per poter dichiarare "chiuso" (dal punto di vista SOFTEAM) un ticket. La figura prevista per questa fase è un Junior.'),
	('AGGIORNAMENTO DOCUMENTAZIONE', 'E\' il tempo (espresso in h/uomo) che viene speso per produrre e/o aggiornare documentazione e procedure di deply ad uso e consumo del personale ICBPI che dovrà procedere ad effettuare i test di accettazione. La figura prevista per questa fase è un Junior.'),
	('GOVERNANCE', 'Riunioni presso Cliente (Comprese Ore di Viaggio).'),
	('SUPPORTO', 'Attività di Supporto'),
	('SUPP. TELEFONICO', 'Supporto Telefonico anche in assenza di Ticket'),
	('PREDISPOSIZIONE AMBIENTE HW/SW', 'Predisposizione ambienti di sviluppo e test c/o Softeam.');
